def palindromes_of_specific_lengths(s):
    s = s[70:141]
    pals = set()
    for i in range(len(s)):
        for j in range(i + 3, min(i + 61, len(s) + 1)):
            sub = s[i:j]
            if sub == sub[::-1] and sub.isalpha():
                pals.add(sub.lower())
    return pals
